                        <span className="logo2" id="logo2">
                          DarkBank
                        </span>
                      </div> */
        } <
        div className = "menu-icon" >
        <
        span >
        <
        i className = "fa fa-bars"
        onClick = { sideBarNav } > < /i> <
        /span> <
        /div> <
        div className = "right-Nav" >
        <
        i className = "fa fa-user" > < /i> <
        span style = {
            { marginLeft: "0.5em" } } > John Doe < /span> <
        /div> <
        /header> <
        /div> <
        /div>
    );
}

export default AdminHeader;
